import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"

const App = () => {
  return (

    <div className="container">
      <h1 className="text-center">Welcome</h1>
      <br />
      <button className="btn">Welcome to react js</button>
    </div>

  );
};

export default App;
